import React from 'react'
import ExpenseDate from './ExpenseDate'
import './Expense.css'
const Expense = () => {
    const expense = [
        {
            id: 1,
            title: 'Buy Car',
            amount: 212.00,
            date: new Date(2021, 20, 10)
        },
        {
            id: 2,
            title: 'Car Asurance',
            amount: 200.00,
            date: new Date(2021, 10, 10)
        },
        {
            id: 3,
            title: 'Eat',
            amount: 10.00,
            date: new Date(2021, 9, 10)
        },
    ]
    return (
        <div>
            <div>
                <ExpenseDate item={expense}/>    
            </div>
        </div>
    )
}

export default Expense
